package main

func longestCommonPrefix(strs []string) string {

	var s string //返回的前缀

	//得到字符串数组中的最短字符串，避免接下来的字符串匹配发生下标越界
	minLen := 201 //最短字符串的长度
	minIndex := 0 //最短字符串的下标
	for i := 0; i < len(strs); i++ {
		if len(strs[i]) < minLen {
			minLen = len(strs[i])
			minIndex = i
		}
	}

	max := 201 //当前可能存在的最长前缀，以后如果匹配超出了这个数字，那必然是不可以往后面写字符串的
	for i := 0; i < len(strs); i++ {
		if i == minIndex { //拿最短字符串作为参照组，如果自己比较自己，则立刻中止这次比较，continue下一次比较
			continue
		}
		for j := 0; j < len(strs[minIndex]); j++ {
			if strs[minIndex][j] != strs[i][j] { //当发现有一个字符不匹配时立刻中止本次比较，break到下一个字符串的比较
				if j < len(s) && len(s) != 0 { //此时如果发现不匹配的字符长度 居然比 字符串s的长度 要小时 ，立刻剪掉多出来的长度
					s = s[:j]
				}
				max = j
				break
			} else if strs[minIndex][j] == strs[i][j] { //如果字符串匹配，
				if j >= len(s) && j < max { //且已匹配字符的长度 比 s的长度 要大时，则立刻写入这一字符 (但是不可以超出目前已匹配的最大长度)
					s += string(strs[minIndex][j])
				}
			}
		}
	}
	return s
}

